/**
 * 页面名_模块名_类型名
 */
const postState = {
    post_article_list: (action) => {
        return {
            default: {},
            type: 'indexArticleList',
            data: {
                index_article_list: action? action.data: {}
            }
        }
    }
}

export default postState;
